import React from "react";
import ReactDom from "react-dom";
import "./index.css";

const firstBook = {
  img:
    "https://images-na.ssl-images-amazon.com/images/I/51XhQYvFvqL._AC_SX184_.jpg",
  title: "1st title",
  author: "Alemia hep",
};

const secondBook = {
  img:
    "https://images-na.ssl-images-amazon.com/images/I/51XhQYvFvqL._AC_SX184_.jpg",
  title: "Harry P",
  author: "jk rowling",
  popularity: "millions of readers",
};

// CSS

function BookList() {
  return (
    <section className="booklist">
      <Book
        img={firstBook.img}
        title={firstBook.title}
        author={firstBook.author}
      />
      <Book
        img={secondBook.img}
        title={secondBook.title}
        author={secondBook.author}
        popularity={secondBook.popularity}
      />
    </section>
  );
}

const Book = (props) => {
  console.log(props);
  return (
    <article className="book">
      <img src={props.img} alt="" />

      <p>{props.job}</p>
      <p>{props.title}</p>
      <p>{props.number}</p>
      <p>{props.author}</p>
      <p>{props.popularity}</p>
      <Price />
    </article>
  );
};

const Price = () => <h2>$5</h2>;

ReactDom.render(<BookList />, document.getElementById("root"));
